import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './Login';
import Register from './Register';

function App() {
  return (
    <div className="App">
      <Router>
        <div>
        <Routes>
          <Route path='/register' element={<Register/>} />
        </Routes>
      </div>
    </Router>
    </div>
  );
}

export default App;
